import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';
import Login from './pages/Login';
import Register from './pages/Register';
import Logout from './pages/Logout';
import Profile from './pages/Profile';
import CreateSkill from './pages/CreateSkill';
import AllSkills from './pages/AllSkills';
import MySkills from './pages/MySkills';
import ReceivedRequests from './pages/ReceivedRequests';
import SentRequests from './pages/SentRequests';
import SessionList from './pages/SessionList';
import AdminLogin from './pages/AdminLogin';
import AdminDashboard from './pages/AdminDashboard';
import UserDashboard from './pages/UserDashboard';
import Navbar from './components/Navbar';

const styles = {
  nav: {
    // background: '#181818',
    padding: '1rem',
    display: 'flex',
    justifyContent: 'center',
    gap: '1rem',
    // background: 'transparent',
  },
  link: {
    color: '#fff',
    textDecoration: 'none',
    fontWeight: 'bold',
    fontSize: '1.1rem',
  },
  // app: {
  //   minHeight: '100vh',
  //   background: '#111',
  // },
};

function App() {
  const isLoggedIn = !!localStorage.getItem('token');
  return (
    <>
      <style>{`
        html, body, #root {
          height: 100vh;
          width: 100vw;
          margin: 0;
          padding: 0;
          overflow: hidden;
          background: transparent !important;
        }
        body {
          background: transparent !important;
        }
        nav {
          margin: 0;
          padding: 0;
          top: 0;
          left: 0;
        }
      `}</style>
      <Router>
        <Navbar />
        <div>
          <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/skills" element={<AllSkills />} />
            <Route path="/skills/create" element={<CreateSkill />} />
            <Route path="/skills/mine" element={<MySkills />} />
            <Route path="/requests/received" element={<ReceivedRequests />} />
            <Route path="/requests/sent" element={<SentRequests />} />
            <Route path="/sessions" element={<SessionList />} />
            <Route path="/profile" element={<Profile />} />
            <Route path="/dashboard" element={<UserDashboard />} />
            <Route path="/logout" element={<Logout />} />
            {/* Admin routes */}
            <Route path="/admin/login" element={<AdminLogin />} />
            <Route path="/admin/dashboard" element={<AdminDashboard />} />
            <Route path="*" element={<Navigate to="/skills" />} />
          </Routes>
        </div>
      </Router>
    </>
  );
}

export default App;
